import React, {Component} from 'react';
import './App.css';
import UserOutput from './UserOutput/UserOutput';
import UserInput from './UserInput/UserInput';

class App extends Component {
  state = {
    nameList: [
      {name: 'Vicky'},
      {name: 'Kent'},
      {name: 'Kona'}
    ]
  }

  render() {
    return (
      <div className="App">
        <UserInput />
        <UserOutput name={this.state.nameList}/>
      </div>
    );
  }

}

export default App;
